Frontlines Fuel of War
Region : FREE
Release Date : Feb 25, 2008
Size : 7.8 GB ISO

The first project for Kaos Studios (a division of THQ founded by veterans of Trauma Studios, creators of Desert Combat and Battlefield 2 R&amp;D projects), Frontlines: Fuel of War uses the advanced Unreal 3 engine for futuristic, intense fights in an open-world battlefield. In this all-too-bleak future of constant wars over natural resources, two sides compete for global supremacy: the Western Coalition (the United States and the European Union) and the Red Star Alliance (Russian/People's Republic of China). The game's nonlinear single-player campaign has players advancing their side's frontline into enemy territory.
Release Date: February 29, 2008
MSRP: 59.99 USD
16 for Ages 16 and up: Blood, Language, Violence
Genre: First-Person Shooter
Publisher: THQ
Developer: Kaos Studios
